import React from 'react';

import '../css/styles.css';

function Home() {
    return (
        <div class="container">

        <div class="list">

          <h2 class="toDo" type="text" placeholder="Add your todo's here" autofocus maxlength="40">Bills</h2>

          <ul>

            <li>Pick up kids</li>

            <li>Take Dre to rugby
            </li>

            <li>Take Florence to ballet
            </li>

          </ul>

        </div>

      </div>
    );
  }

  export default Home;
